var Cons = function(){
    var self = this;
    self.data = [
        {id:0, code:'STOP', des:"下线"},
        {id:1, code:'OPEN', des:"上线"}
    ];

    self.id = {};

    for(var i = 0; i < self.data.length; i++)
    {
        var set = self.data[i];
        self[set.code] = set;

        self.id[set.id] = set;
    }
};
module.exports = new Cons();

